import "./App.css";
import logo from "./images/logo.jpeg";
function App() {
  return (
    <div className="bg-pink-50">
      <Header />
    </div>
  );
}

export default App;

function Header() {
  return (
    <div className="flex flex-row h-20 w-screen py-2">
      <img src={logo} alt="logo" className=""></img>
      <div className="flex flex-row justify-end bg-purple-200 justify-center">
        <div>
          <h1>Features</h1>
        </div>
        <div>.</div>
      </div>
    </div>
  );
}
